			var url = Globals.path + "/MyAccount/AJAX";
			var params = {
				method: "completeACIOrder",
				patronId: patronId,
				paymentId: paymentId,
				accessToken: accessToken,
				fundingToken: fundingToken,
				type: transactionType,
				billerAccountId: billerAccountId
			};
